import React from 'react'
import '../css/Menu.css'

function Menu() {
    var a=1;

    const OpenForm = () => {
        return (
            <div></div>
        )
    }

    return (
        <div className="menu_system">
            <button onClick={OpenForm} className="add__btn">Добавить</button>
            {
                a===1
                    ? <form>
                        <label for="name">Name:</label>
                        <input type="text"
                            name="name_system"
                            value="" />
                        <input type="button"
                            value="Создать" />
                    </form>
                    : none
            }
        </div>
    )
}

export default Menu
